content.css:
.customVisual {
  width: 100%;
  height: 100%;
}
.userInfoContainer {
  font-family: Arial, sans-serif;
  display: flex;
  justify-content: start;
  align-items: center;
  gap: 20px;
  margin: 8px 8px;
}
.userInfoTextContainer {
  font-family: Arial, sans-serif;
  display: flex;
  flex-direction: column;
  justify-content: space-evenly;
  align-items: start;
}
.name {
  text-transform: capitalize;
  font-size: 26px;
  margin: 0;
}
.rating {
  font-size: 20px;
  margin: 0;
  margin-top: 5px;
  font-weight: normal;
}
.userImage {
  height: 120px;
}
.reviewContainer {
  overflow: auto;
  /* Enable scrolling */
}
.review-text {
  overflow: auto;
  /* Enable scrolling */
  max-height: 100%;
  /* Ensure it doesnt exceed container height */
  line-height: 1.4;
  /* Adjust line height for readability */
  font-size: 12px;
  /* Adjust font size as needed */
  padding: 20px;
  /* Optional padding */
  font-size: 24px;
  font-style: italic;
}
